import "./App.css";

function App() {
  return (
    <div className="w-[100vw] h-[100vh] flex justify-center items-center bg-[#344151] flex-col gap-10">
      <div className="text-[#0398d4] font-medium text">Increment & Decrement</div>
      
      <button>-</button>

    <div>
      <button>+</button>
    </div>
    <div>
      <button>Reset</button>
    </div>
    </div>
  );
}

export default App;
